import './App.css';
import { gsap, InertiaPlugin, Draggable } from "gsap/all";

class HomePage extends Component {
  componentDidMount() {
    gsap.registerPlugin(Draggable, InertiaPlugin);

    Draggable.create(".draggable", {
      bounds: ".container",
      inertia: true,
      onPress: function() {
        console.log("clicked");
      },
      onClick: (e) => {
        console.log('CLICKED', e.target)
        // e.target.style.backgroundColor= 'blue'
    }

    });
  }

  render() {
    return (
      <div className='container'>
        <h2 className="cedarville-cursive-regular">Jade and Seka</h2>
        <img src={require('./sd_card.png')} alt='sd_card' className="draggable image-context" />
      </div>
    );
  }
}


export default HomePage;
